import Link from 'next/link'
import styles from './Example.module.css '

const HeaderM = () => (

    <div className={styles.headerContainer1}>
        <Link chref='/'>
            <a className={styles.headerContainer2}>Home</a>
        </Link>
    </div>
)

export default HeaderM;
